import { Grid } from "@mui/material";
import React from "react";

const HomeShortCutIcons = () => {
  return (
    <div>
      <Grid container spacing={2}>
        <Grid item xs={12} sm={3}>
          a
        </Grid>
        <Grid item xs={12} sm={3}>
          b
        </Grid>
        <Grid item xs={12} sm={3}>
          c
        </Grid>
        <Grid item xs={12} sm={3}>
          d
        </Grid>
      </Grid>
    </div>
  );
};

export default HomeShortCutIcons;
